import styled from "styled-components";
import { ReactComponent as DogFooter } from "../../Assets/dogs-footer.svg";

export const FooterUI = styled.footer`
  background: #fb1;
  padding: 3rem 1rem 0 1rem;
  height: 10rem;
  text-align: center;
  color: #764701;
`;

export const Direitos = styled.p`
  margin-top: 1rem;
`;

export const IconFooter = styled(DogFooter)``;
